import React from 'react';
import './Home.css';

function SearchBar() {
  return (
    <div className="search-wrap">
      <input className="search-input" placeholder="Search items, creators, categories" />
      <button className="search-btn">Search</button>
    </div>
  );
}

function CategoryPill({ title }) {
  return <div className="cat-pill">{title}</div>;
}

function ItemCard({ title, price, image }) {
  return (
    <div className="item-card">
      <div className="item-image" style={{ backgroundImage: `url(${image})` }} />
      <div className="item-info">
        <div className="item-title">{title}</div>
        <div className="item-meta">
          <div className="price">{price}</div>
          <button className="bid-btn">Bid</button>
        </div>
      </div>
    </div>
  );
}

export default function App() {
  const categories = [
    'Collectibles',
    'Sneakers',
    'Designer',
    'Toys',
    'Art',
    'Sports Cards',
  ];

  const items = Array.from({ length: 8 }).map((_, i) => ({
    title: `Amazing Item #${i + 1}`,
    price: `$${(20 + i * 15).toFixed(2)}`,
    image: `https://picsum.photos/seed/whatnot${i}/600/400`,
  }));

  return (
    <div className="app-container">
      {/* Hero */}
      <section className="hero">
        <div className="hero-inner">
          <h1 className="hero-title">Live auctions & drops — discover & buy from creators</h1>
          <p className="hero-sub">Join live auctions, claim limited drops, and connect with creators worldwide.</p>
          <SearchBar />

          <div className="categories">
            {categories.map((c) => (
              <CategoryPill key={c} title={c} />
            ))}
          </div>
        </div>
        <div className="hero-aside">
          <div className="live-card">
            <div className="live-badge">LIVE</div>
            <div className="live-title">Live Now: Rare Sneakers Drop</div>
            <div className="live-sub">Host: SneakerKing • 2.3k watching</div>
            <div className="watch-btn">Watch</div>
          </div>
        </div>
      </section>

      {/* Featured grid */}
      <section className="grid-section">
        <h2 className="section-title">Trending Auctions</h2>
        <div className="grid">
          {items.map((it, idx) => (
            <ItemCard key={idx} {...it} />
          ))}
        </div>
      </section>

      {/* Quick links / CTA */}
      <section className="cta-strip">
        <div className="cta-inner">
          <div>
            <h3>Want to sell live?</h3>
            <p>Start auctions in minutes and reach thousands of collectors.</p>
          </div>
          <button className="primary">Start Selling</button>
        </div>
      </section>

      {/* Minimal legal strip */}
      <section className="legal-strip">
        <div className="legal-inner">© {new Date().getFullYear()} Whatnot-style demo · Built with React + plain CSS</div>
      </section>
    </div>
  );
}
